long long maximumTripletValue(int* nums, int numsSize) {
    long long maxVal = 0, max_i = INT_MIN, max_k = INT_MIN;
    int* max_j = (int*)malloc(numsSize * sizeof(int));
    max_j[numsSize - 1] = nums[numsSize - 1];
    for (int i = numsSize - 2; i >= 0; i--) {
        if (nums[i] > max_j[i + 1]) {
            max_j[i] = nums[i];
        } else {
            max_j[i] = max_j[i + 1];
        }
    }
    for (int j = 1; j < numsSize - 1; j++) {
        if (nums[j - 1] > max_i) {
            max_i = nums[j - 1];
        }
        if (max_j[j + 1] > max_k) {
            max_k = max_j[j + 1];
        }
        long long currentVal = (max_i - nums[j]) * max_k;
        if (currentVal > maxVal) {
            maxVal = currentVal;
        }
    }
    free(max_j);
    return maxVal;
}
